import React from 'react';

function Skills() {
  const skills = {
    languages: ['Java', 'PHP', 'JavaScript', 'HTML/CSS', 'SQL'],
    frameworks: ['React', 'Laravel', 'Bootstrap'],
    tools: ['Git', 'VS Code', 'MySQL', 'PHPMyAdmin'],
    soft: ['Travail en équipe', 'Gestion de projet', 'Résolution de problèmes']
  };

  return (
    <section id="skills" className="skills">
      <h2>Compétences</h2>
      <div className="skills-grid">
        <div className="skill-category">
          <h3>Langages</h3>
          <ul>
            {skills.languages.map(skill => <li key={skill}>{skill}</li>)}
          </ul>
        </div>
        <div className="skill-category">
          <h3>Frameworks</h3>
          <ul>
            {skills.frameworks.map(skill => <li key={skill}>{skill}</li>)}
          </ul>
        </div>
        <div className="skill-category">
          <h3>Outils</h3>
          <ul>
            {skills.tools.map(skill => <li key={skill}>{skill}</li>)}
          </ul>
        </div>
        <div className="skill-category">
          <h3>Soft Skills</h3>
          <ul>
            {skills.soft.map(skill => <li key={skill}>{skill}</li>)}
          </ul>
        </div>
      </div>
    </section>
  );
}

export default Skills;
